import React, { useState } from 'react'

const Todoapp = () => {
  const dummy_todos = [
    { id: 1, text: 'Swimming' },
    { id: 2, text: 'Sleeping' },
    { id: 3, text: 'Crying' },
    { id: 4, text: 'Living' },
  ]
  const [todos,setTodos] = useState(dummy_todos);
  return (
    <div>
      {dummy_todos}
    </div>
  )
}

export default Todoapp
